    static Leagues lookUpLeagues() {
        String lookupLeague = "{\"leagues\":[{\"idLeague\":\"4338\",\"idSoccerXML\":\"11\",\"strSport\":\"Soccer\",\"strLeague\":\"Belgian Jupiler League\",\"strLeagueAlternate\":\"Jupiler Pro League\",\"strDivision\":\"1\",\"idCup\":\"0\",\"intFormedYear\":\"1895\",\"dateFirstEvent\":\"2012-07-28\",\"strGender\":\"Male\",\"strCountry\":\"Belgium\",\"strWebsite\":\"www.jupilerproleague.be\",\"strFacebook\":\"www.facebook.com\\/jupilerproleague\",\"strTwitter\":\"twitter.com\\/JPLeagueFR\",\"strYoutube\":\"\",\"strRSS\":\"\",\"strDescriptionEN\":\"The Belgian Pro League (officially known as Jupiler Pro League ) is the top league competition for association football clubs in Belgium. Contested by 16 clubs, it operates on a system of promotion and relegation with the Belgian Second Division. Seasons run from late July to early May, with teams playing 30 matches each in the regular season, and then entering play-offs 1, play-offs 2 or the relegation play-off according to their position in the regular season. Play-offs 1 are contested by the top 6 clubs in the regular season, with each club playing each other twice. Play-offs 2 are contested by teams ranked 7 to 14 in the regular season, divided in two groups of 4 teams playing each other twice. The relegation play-off consists of 5 matches between the 15th and the 16th-placed team in the regular season. As of 2014 the league was sponsored by AB InBev, brewers of Jupiler beer, and officially known as Jupiler Pro League.\\r\\n\\r\\nThe competition was created in 1895 by the Royal Belgian Football Association and was first won by FC Liégeois. Of the 74 clubs to have competed in the first division since its creation, 15 have been crowned champions of Belgium. RSC Anderlecht is the most successful league club with 33 titles, followed by Club Brugge KV (13), Union Saint-Gilloise (11) and Standard Liège (10). It is currently ranked 10th in the UEFA rankings of leagues based on performances in European competitions over the last five-years. The competition was ranked 3rd when the UEFA first published their ranking in 1979 and also the next year in 1980, which is the best ranking the Belgian First Division has ever achieved.\",\"strDescriptionDE\":null,\"strDescriptionFR\":\"Le championnat de Belgique de football est une compétition de football-association créée en 1895. En Belgique, le terme « championnat » s'applique à toutes les divisions. La plus haute, souvent dénommée « Division 1 », porte le nom officiel de « Jupiler Pro League » d’après le sponsor Jupiler.\\r\\n\\r\\nLes clubs belges les plus titrés sont le RSC Anderlecht avec 33 titres, le FC Bruges avec 13, l'Union St-Gilloise avec 11 et le Standard de Liège avec 10.\",\"strDescriptionIT\":null,\"strDescriptionCN\":null,\"strDescriptionJP\":null,\"strDescriptionRU\":null,\"strDescriptionES\":null,\"strDescriptionPT\":null,\"strDescriptionSE\":null,\"strDescriptionNL\":null,\"strDescriptionHU\":null,\"strDescriptionNO\":null,\"strDescriptionPL\":null,\"strDescriptionIL\":null,\"strFanart1\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/fanart\\/xtpvqu1422244531.jpg\",\"strFanart2\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/fanart\\/rxxuru1422402189.jpg\",\"strFanart3\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/fanart\\/sturtr1422401520.jpg\",\"strFanart4\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/fanart\\/rvwxts1426824964.jpg\",\"strBanner\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/banner\\/urswyw1424489964.jpg\",\"strBadge\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/badge\\/8y3jti1564838854.png\",\"strLogo\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/logo\\/ttxvrs1422402616.png\",\"strPoster\":null,\"strTrophy\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/league\\/trophy\\/tvuvwy1422267731.png\",\"strNaming\":\"{strHomeTeam} vs {strAwayTeam}\",\"strComplete\":null,\"strLocked\":\"unlocked\"}]}";
        return gson.fromJson(lookupLeague, Leagues.class);
    }

    static Teams lookUpTeam() {
        String lookupTeam = "{\"teams\":[{\"idTeam\":\"135162\",\"idSoccerXML\":\"1347\",\"intLoved\":null,\"strTeam\":\"Godoy Cruz\",\"strTeamShort\":null,\"strAlternate\":\"\",\"intFormedYear\":\"1921\",\"strSport\":\"Soccer\",\"strLeague\":\"Argentinian Primera Division\",\"idLeague\":\"4406\",\"strDivision\":null,\"strManager\":\"Diego Dabove\",\"strStadium\":\"Estadio Feliciano Gambarte\",\"strKeywords\":\"\",\"strRSS\":\"\",\"strStadiumThumb\":null,\"strStadiumDescription\":\"Estadio Feliciano Gambarte is a multi-use stadium in Godoy Cruz, Mendoza, Argentina. It is used primarily for football matches and is the home ground of Godoy Cruz Antonio Tomba. The stadium holds 14,000 people and was built in 1959.\",\"strStadiumLocation\":\"Godoy Cruz, Mendoza, Mendoza Province\",\"intStadiumCapacity\":\"14000\",\"strWebsite\":\"\",\"strFacebook\":\"\",\"strTwitter\":\"\",\"strInstagram\":\"\",\"strDescriptionEN\":\"Club Deportivo Godoy Cruz Antonio Tomba, known simply as Godoy Cruz, is an Argentine sports club from Godoy Cruz, Mendoza. The club is best known for its football team, that plays in the Primera División, the top level of the Argentine football league system.\\r\\n\\r\\nOther activities practised at Godoy Cruz are basketball, team handball, field hockey, tennis and volleyball.\\r\\n\\r\\nHistory\\r\\nGodoy Cruz was born as an institution in 1921. It all started when a group of friends, gathered in the \\\"Victoria Bar\\\" (located opposite the departmental square at that time), decided to found a club, taking advantage of the boom at the time . Thus was born on 1 June 1921, the Club Sportivo Godoy Cruz with the novice presidency of Don Romero Garay.\\r\\n\\r\\n\\r\\nThe team of 1954.\\r\\nThe club was founded on 21 June 1921 under the name sportivo Godoy Cruz, and changed to its current name on 25 April 1930 after the fusion with Deportivo Bodega Antonio Tomba. In 1959, Godoy Cruz' stadium, the , was constructed. The stadium is nicknamed La Bodega (Spanish for \\\"wine cellar\\\") and holds 21,000 people.\\r\\n\\r\\nGodoy Cruz played in the regional league for several years before reaching the national level. The club won the Mendoza first division championship in 1944, 1947, 1950, 1951, 1954, 1968, and also in 1989 and 1990 that qualified to play in the defunct Torneo del Interior national-level tournament.\\r\\n\\r\\nWinning the Torneo del Interior in 1994, Godoy Cruz reached the Primera B Nacional (Argentine second division) that year. After more than ten years in the second division, the club was finally promoted to the Primera División in 2006, after winning the 2005–06 season of the Primera B Nacional, defeating Nueva Chicago in the final.\\r\\n\\r\\nTwenty-year-old Enzo Pérez scored the first goal by Godoy Cruz in the Argentine Primera, in a 1–1 draw with Belgrano on 9 September 2006.\\r\\n\\r\\nAt the end of the 2006–07 season, Godoy Cruz was relegated from the Primera after losing their promotion\\/relegation play-off with Huracán. Their stay in the second division was short, as they earned automatic promotion to the first division after finishing runners-up to San Martín de Tucumán during the 2007–08 season.\\r\\n\\r\\nGodoy Cruz secured their best ever league position of 3rd place under Omar Asad's management during the 2010 Clausura. In that tournament, they also achieved the best-ever point total (37) for a team indirectly affiliated to the Argentine Football Association (meaning clubs under the administration of the Federal Council branch of AFA, which are teams outside Buenos Aires, Greater Buenos Aires, Rosario and Santa Fe). These results qualified them for the 2011 Copa Libertadores, their first appearance in this tournament.\\r\\n\\r\\nIn his participation in the Superliga Argentina, in the season 2017\\/18, Godoy Cruz, with his coach Diego Dabove achieved an excellent campaign, obtaining the second place in the season. The \\\"Tomba\\\" got 56 points in 27 games played, one of the milestones of the team in this championship was to get a record of 6 consecutive wins, in addition to having had the scorer of the season, Santiago García, who converted 17 goals.\",\"strDescriptionDE\":null,\"strDescriptionFR\":null,\"strDescriptionCN\":null,\"strDescriptionIT\":null,\"strDescriptionJP\":null,\"strDescriptionRU\":null,\"strDescriptionES\":null,\"strDescriptionPT\":null,\"strDescriptionSE\":null,\"strDescriptionNL\":null,\"strDescriptionHU\":null,\"strDescriptionNO\":null,\"strDescriptionIL\":null,\"strDescriptionPL\":null,\"strGender\":\"Male\",\"strCountry\":\"Argentina\",\"strTeamBadge\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/team\\/badge\\/d3c0ds1517768584.png\",\"strTeamJersey\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/team\\/jersey\\/swvyvu1423784034.png\",\"strTeamLogo\":null,\"strTeamFanart1\":null,\"strTeamFanart2\":null,\"strTeamFanart3\":null,\"strTeamFanart4\":null,\"strTeamBanner\":null,\"strYoutube\":\"\",\"strLocked\":\"unlocked\"}]}";
        return gson.fromJson(lookupTeam, Teams.class);
    }

    static Leagues listLeagues() {
        String searchAllLeague = "{\"countrys\":[{\"idLeague\":\"4406\",\"idSoccerXML\":null,\"strSport\":\"Soccer\",\"strLeague\":\"Argentinian Primera Division\",\"strLeagueAlternate\":\"\",\"strDivision\":\"1\",\"idCup\":\"0\",\"intFormedYear\":\"1891\",\"dateFirstEvent\":\"2015-02-13\",\"strGender\":\"Male\",\"strCountry\":\"Argentina\",\"strWebsite\":\"www.afa.org.ar/index.php?option=com_wrapper&view=wrapper&Itemid=94\",\"strFacebook\":\"\",\"strTwitter\":\"\",\"strYoutube\":\"www.youtube.com/channel/UCJmCVoUfCBQb9lcfXIS8nXQ\",\"strRSS\":\"\",\"strDescriptionEN\":\"The Primera División (Spanish pronunciation: ; English: First Division), named Superliga Argentina (English: Argentine Superleague) since the 2017–18 season, is a professional football league in Argentina, organised by the homonymous entity, that is administrated independently and has its own statute. Nevertheless, the Superliga is contractually linked with the main football body, the Argentine Football Association (AFA) that had been organising all the championships from 1893 to 2017.\\r\\n\\r\\nThe Primera División is the country's premier football division and is at the top of the Argentine football league system. It operates on a system of promotion and relegation with the Primera B Nacional (second division), with the teams placed lowest at the end of the season being relegated. The season runs from August to May.\\r\\n\\r\\nIn 1891 Argentina was the first country outside the United Kingdom to establish a football league. In the early years, only teams from Buenos Aires and Rosario were affiliated to the national association. Teams from other cities would join in later years.\\r\\n\\r\\nThe Primera División turned professional in 1931 when 18 clubs broke away from the amateur leagues to form a professional one. Since then, the season has been contested annually in four different formats and calendars. The league has been under its current format since the 2015 season.\\r\\n\\r\\nThe Argentine championship was ranked in the top 10 as one of the strongest leagues in the world (for the 1st January 2015 – 31 December 2015 period) by the International Federation of Football History & Statistics (IFFHS). Argentina placed 4th after La Liga (Spain), Serie A (Italy) and Bundesliga (Germany).\",\"strDescriptionDE\":null,\"strDescriptionFR\":\"Le Championnat d'Argentine de football (espagnol : Primera División) est une compétition de football organisée par l'AFA (Asociación del Fútbol Argentino), opposant les 20 meilleures équipes d'Argentine et couronnant deux champions par an. La première partie du championnat, appelée Initial (Inicial) se dispute d'août à décembre et la seconde partie, appelée Final, se dispute de février à juin.\\r\\n\\r\\nLe championnat d'Argentine est, selon l'IFFHS, l'un des meilleurs championnats du monde. Il était en 2013 considéré comme le 6e meilleur du monde. Il alimente en joueurs de très nombreux championnats européens et mondiaux, notamment la Liga espagnole, la Serie A ou la Premier League.\\r\\n\\r\\nLes clubs argentins ont obtenu 62 titres internationaux, un record mondial.\\r\\n\\r\\nPromotions et relégations n'ont lieu qu'en juin, à l'issue du tournoi Final, par un système complexe de moyennes. Les équipes ayant obtenu les plus mauvaises moyennes sont reléguées en deuxième division.\",\"strDescriptionIT\":null,\"strDescriptionCN\":null,\"strDescriptionJP\":null,\"strDescriptionRU\":null,\"strDescriptionES\":\"El campeonato de Primera División del fútbol argentino es un torneo organizado por la Asociación del Fútbol Argentino (AFA) y es la máxima categoría del sistema de campeonatos de dicho deporte en Argentina.\\r\\n\\r\\nEn el certamen actual participan treinta equipos, los que son presentados por clubes, asociaciones civiles sin fines de lucro, aunque desde el año 2000 puede darse la situación de que el equipo esté gerenciado por una empresa privada, en representación y con la aprobación del club respectivo.\\r\\n\\r\\nA pesar de haberse decidido oficialmente que, a partir del Campeonato 2015, se cambiaría el modelo de dos torneos cortos, utilizando calendario europeo, a un solo concurso que transcurriría en el año calendario, aumentando el número de participantes a 30 equipos,9 en su reunión del 11 de noviembre de 2014, el Comité Ejecutivo de la Asociación propuso una revisión de lo actuado. Por ese motivo se produjo una controversia sobre el modo de disputa y el calendario de ese certamen,10 11 12 13 14 aunque finalmente, ante la intervención de directivos de la televisión y el gobierno, se propuso respetar lo acordado en la reunión del 3 de junio de 2014 y ratificar el modo de disputa del torneo.15\\r\\n\\r\\nEl concurso se realiza en una ronda de todos contra todos, con el agregado de un partido según los emparejamientos realizados por la Asociación, basado, en la mayoría de los casos, en los que se consideran rivales clásicos. Esos partidos se jugarán en la 24.ª fecha y en los mismos se invertirá la condición de local con respecto al otro enfrentamiento. De esta manera, cada equipo disputará un total de 30 partidos.\\r\\n\\r\\nPor otro lado, se producirán dos descensos a la segunda división, la Primera B Nacional, determinados según la tabla de promedios de los cuatro últimos torneos. Asimismo, se producirá la clasificación de 3 equipos a la Copa Libertadores 2016 y de otros 5 a la Copa Sudamericana del mismo año, cuyos cupos se completarán con la realización de dos liguillas, método que se reflotará luego de haberse empleado por última vez en la temporada 1991/92.\\r\\n\\r\\nEl Campeonato de Primera División es uno de los mejores del mundo de acuerdo con la Federación Internacional de Historia y Estadística de Fútbol. En la última clasificación, la del año 2014, ocupa el cuarto puesto en el ranking anual de dicha institución,16 que se elabora desde 1991. La Primera División de Argentina, a excepción de 1993, siempre estuvo entre las diez primeras. Su mejor ubicación en este ranking se dio en 2008, cuando logró el tercer lugar, siendo superada apenas por la Premier League de Inglaterra y por la Serie A de Italia. Estas mismas ligas son las que ocupan los tres primeros lugares del escalafón actual, junto con la Primera División de España.\",\"strDescriptionPT\":null,\"strDescriptionSE\":null,\"strDescriptionNL\":null,\"strDescriptionHU\":null,\"strDescriptionNO\":null,\"strDescriptionPL\":null,\"strDescriptionIL\":null,\"strFanart1\":\"https://www.thesportsdb.com/images/media/league/fanart/wrppvx1422244030.jpg\",\"strFanart2\":null,\"strFanart3\":null,\"strFanart4\":null,\"strBanner\":\"https://www.thesportsdb.com/images/media/league/banner/7x4xmv1567241754.jpg\",\"strBadge\":\"https://www.thesportsdb.com/images/media/league/badge/me5dez1517699947.png\",\"strLogo\":\"https://www.thesportsdb.com/images/media/league/logo/sppyvw1422243698.png\",\"strPoster\":null,\"strTrophy\":\"https://www.thesportsdb.com/images/media/league/trophy/xrvqvx1422244125.png\",\"strNaming\":\"{strHomeTeam} vs {strAwayTeam}\",\"strComplete\":null,\"strLocked\":\"unlocked\"},{\"idLeague\":\"4500\",\"idSoccerXML\":null,\"strSport\":\"Soccer\",\"strLeague\":\"Copa Argentina\",\"strLeagueAlternate\":\"\",\"strDivision\":\"99\",\"idCup\":\"1\",\"intFormedYear\":\"1969\",\"dateFirstEvent\":\"0000-00-00\",\"strGender\":\"Male\",\"strCountry\":\"Argentina\",\"strWebsite\":\"www.copaargentina.org\",\"strFacebook\":\"\",\"strTwitter\":\"\",\"strYoutube\":\"\",\"strRSS\":\"\",\"strDescriptionEN\":\"The Copa Argentina (English: Argentine Cup), officially known as the \\\"Copa Total Argentina\\\" due to sponsorship reasons, is an official football cup competition organized by the Argentine Football Association (AFA), with the aim of qualifying one club to the Copa Libertadores.\\r\\n\\r\\nThe first editions of the championship were contested by teams playing in Primera División that did not earn eligibility to participate in the Copa Libertadores of the following year, and the best placed clubs playing in regional leagues.\\r\\n\\r\\nThe tournament was re-launched in 2011, with teams of all divisions that form the Argentine football league system taking part of the championship. The winner of Copa Argentina qualifies for the Supercopa Argentina against the reigning champions of Primera División.\\r\\n\\r\\nBoca Juniors is the most successful team with three titles won, (1969, 2012 and 2015).\\r\\n\\r\\nHistory\\r\\nBackground\\r\\nThe \\\"Campeonato de la República\\\" (or Copa General Pedro Ramírez)) had been the first Argentine cup contested by clubs playing not only in Primera División but in regional leagues as well, with a total of 35 teams in the first edition. The cup was held from 1943 to 1945.\\r\\n\\r\\nA new international competition, \\\"Copa Ganadores de Copa (also known as \\\"Recopa Sudamericana\\\"), organised by CONMEBOL in 1970 as a South American counterpart of UEFA Cup Winners' Cup, served as inspiration to the Argentine Association to create a new competition, with the winner team being eligible to play the 1970 edition of Copa Ganadores de Copa.\\r\\n\\r\\nFirst edition: 1969\\r\\nMain article: 1969 Copa Argentina\\r\\nThe competition was contested by 32 teams using a two-legged elimination format. Two points were awarded for winning a leg, one for a draw and null for a loss. The teams having more points would qualify to the next round. If both teams had same number of points, it would be determined by the total number of goals, total number of goals conceded, and penalty shootout accordingly.\\r\\n\\r\\nAll teams in the Primera División Argentina participated the competition with some top teams from the regional leagues, except teams that had already qualified to the Copa Libertadores, namely, Vélez Sársfield and River Plate, the winners and runners-up of 1968 Nacional respectively, and Estudiantes de La Plata, the champions of 1968 Copa Libertadores.\\r\\n\\r\\nBoca Juniors and Atlanta entered the final. Boca won the tournament by defeating Atlanta 3–2 on aggregate after two matches were played.\\r\\n\\r\\nHowever, as Boca later won the 1969 Nacional and qualified to the 1970 Copa Libertadores, Atlanta qualified to the 1970 \\\"Copa Ganadores de Copa\\\" as the runner-up.\\r\\n\\r\\nSecond edition: 1970\\r\\nMain article: 1970 Copa Argentina\\r\\nApart from teams that had got the Copa Libertadores eligibility, namely Boca Juniors and River Plate, the champions and runners-up of Nacional 1969, and Estudiantes de La Plata, who won the Copa Libertadores 1969, all clubs in the Primera División Argentina participated this competition. The champions of Primera B, Ferro, also took part in the tournament, along with 13 top clubs from regional leagues.\\r\\n\\r\\nCopa Argentina 1970 never finished. 32 teams played the competition and San Lorenzo and Vélez Sársfield entered the final. The tournament had been lasting for a long period in that year. Starting in March 1970, the first leg of the final was played in March 1971. At that time, the Copa Ganadores de Copa, which the winner of Copa Argentina would be qualifying for, had already started. Moreover, as Huracán Buceo and Deportes Concepción, the two other team in the same group with the Argentine representative in the Copa Ganadores de Copa, had not confirmed their participation, so the organizer announced the Copa Ganadores de Copa would become a friendly tournament. Therefore, after the first leg of the Copa Argentina final was held, which the teams drew 2-2, the second leg was never played. No Argentine teams participated in the Copa Ganadores de Copa 1971.\\r\\n\\r\\nRelaunch\\r\\nMain article: 2011-12 Copa Argentina\\r\\nThe reschedule of the Copa Argentina –officialized in 2011– included 186 teams of 7 divisions of the Argentine football league system in a knock-out system competition. All the matches were disputed in neutral locations. The teams of the first division were included in rounds of 32. The champion of the tournament qualified for the next edition of Copa Sudamericana.\\r\\n\\r\\nFor the relaunching of the tournament, a new trophy was designed. The cup, made of aluminium, was manufactured at the Norberto Ambrosetti factory of Lobos, Buenos Aires.\\r\\n\\r\\nThe 2012 final between Boca and Racing was scheduled many times due to fixture congestion. The match was finally played on August 8, 2012, at the Estadio del Bicentenario in San Juan. Boca Juniors won its second trophy after defeating Racing Club by 2-1.\\r\\n\\r\\nThe 2012–13 Copa Argentina was scheduled to begin October 23, 2012 in a new two-phase knock-out competition. Arsenal defeated San Lorenzo and won its first trophy of this competition.\",\"strDescriptionDE\":null,\"strDescriptionFR\":null,\"strDescriptionIT\":null,\"strDescriptionCN\":null,\"strDescriptionJP\":null,\"strDescriptionRU\":null,\"strDescriptionES\":null,\"strDescriptionPT\":null,\"strDescriptionSE\":null,\"strDescriptionNL\":null,\"strDescriptionHU\":null,\"strDescriptionNO\":null,\"strDescriptionPL\":null,\"strDescriptionIL\":null,\"strFanart1\":null,\"strFanart2\":null,\"strFanart3\":null,\"strFanart4\":null,\"strBanner\":null,\"strBadge\":\"https://www.thesportsdb.com/images/media/league/badge/mekufm1549460132.png\",\"strLogo\":\"https://www.thesportsdb.com/images/media/league/logo/65t73z1563098226.png\",\"strPoster\":null,\"strTrophy\":null,\"strNaming\":\"{strHomeTeam} vs {strAwayTeam}\",\"strComplete\":null,\"strLocked\":\"unlocked\"},{\"idLeague\":\"4356\",\"idSoccerXML\":\"42\",\"strSport\":\"Soccer\",\"strLeague\":\"Australian A-League\",\"strLeagueAlternate\":\"\",\"strDivision\":\"1\",\"idCup\":\"0\",\"intFormedYear\":\"2004\",\"dateFirstEvent\":\"2013-10-11\",\"strGender\":\"Male\",\"strCountry\":\"Australia\",\"strWebsite\":\"www.a-league.com.au\",\"strFacebook\":\"www.facebook.com/aleague\",\"strTwitter\":\"twitter.com/aleague\",\"strYoutube\":\"www.youtube.com/user/TheHyundaiALeague\",\"strRSS\":\"\",\"strDescriptionEN\":\"The A-League is a professional men's soccer league, run by Football Federation Australia (FFA). At the top of the Australian league system, it is the country's primary competition for the sport. The A-League was established in 2004 as a successor to the National Soccer League (NSL) and competition commenced in August 2005. The league is currently contested by ten teams; nine based in Australia and one based in New Zealand. It is known as the Hyundai A-League (HAL) through a sponsorship arrangement with the Hyundai Motor Company.\\r\\n\\r\\nSeasons run from October to May and include a 27-round regular season and an end-of-season finals series playoff tournament involving the highest-placed teams, culminating in a grand final match. The winner of the regular season tournament is dubbed 'premier' and the winner of the grand final is 'champion'. This differs from the other major football codes in Australia, where 'premier' refers to the winner of the grand final and the winner of the regular season is the 'minor premier'. The A-League's non-standard terminology is reflective of the increased prestige associated with winning the regular season in association football compared to other football codes in Australia. Successful A-League clubs gain qualification into the continental competition, the Asian Football Confederation Champions League (ACL).\\r\\n\\r\\nSince the league's inaugural season, a total of six clubs have been crowned A-League Premiers and five clubs have been crowned A-League Champions. The current premiers and champions are Brisbane Roar, who won both titles in 2013–14.\",\"strDescriptionDE\":null,\"strDescriptionFR\":\"Le championnat d'Australie de football (A-League) a été créé en 1977 sous le nom de National Soccer League. Il s'est interrompu dans sa forme ancienne en 2004 pour laisser la place depuis 2005 à la A-League, un championnat professionnel comptant des équipes australiennes et néozélandaises mais toujours géré par la fédération australienne.\",\"strDescriptionIT\":null,\"strDescriptionCN\":null,\"strDescriptionJP\":null,\"strDescriptionRU\":null,\"strDescriptionES\":null,\"strDescriptionPT\":null,\"strDescriptionSE\":null,\"strDescriptionNL\":null,\"strDescriptionHU\":null,\"strDescriptionNO\":null,\"strDescriptionPL\":null,\"strDescriptionIL\":null,\"strFanart1\":\"https://www.thesportsdb.com/images/media/league/fanart/y7hb2f1547476364.jpg\",\"strFanart2\":\"https://www.thesportsdb.com/images/media/league/fanart/yov7bs1547476369.jpg\",\"strFanart3\":\"https://www.thesportsdb.com/images/media/league/fanart/jopxwu1547476357.jpg\",\"strFanart4\":\"https://www.thesportsdb.com/images/media/league/fanart/zfcwer1547476375.jpg\",\"strBanner\":\"https://www.thesportsdb.com/images/media/league/banner/9s0bc11547476621.jpg\",\"strBadge\":\"https://www.thesportsdb.com/images/media/league/badge/sfhanl1547383730.png\",\"strLogo\":\"https://www.thesportsdb.com/images/media/league/logo/0hrep61547383780.png\",\"strPoster\":\"https://www.thesportsdb.com/images/media/league/poster/3d0fzk1547476123.jpg\",\"strTrophy\":\"https://www.thesportsdb.com/images/media/league/trophy/uxssyx1422266419.png\",\"strNaming\":\"{strHomeTeam} vs {strAwayTeam}\",\"strComplete\":\"yes\",\"strLocked\":\"unlocked\"}]}";
        return gson.fromJson(searchAllLeague, Leagues.class);
    }

